$(document).ready(function() {
    $(".fancybox").fancybox({
        closeClick: !0,
        padding: 0
    }), $(function() {
        $('a[data-target="anchor"]').bind("click.smoothscroll", function() {
            var e = $(this).attr("href"),
                i = $(e).offset().top;
            return $("body, html").animate({
                scrollTop: i
            }, 1e3), !1
        })
    }), $("#countdown_dashboard").countDown({
        targetOffset: {
            day: 0,
            month: 0,
            year: 0,
            hour: 12,
            min: 37,
            sec: 49
        }
    }), $("#countdown_dashboard1").countDown({
        targetOffset: {
            day: 0,
            month: 0,
            year: 0,
            hour: 12,
            min: 37,
            sec: 49
        }
    }),$(document).ready(function() {
        new Swiper(".s4 ", {
            direction: "horizontal",
            speed: 1e3,
            spaceBetween: 0,
            loop: !1,
            slidesPerView: 3,
            allowSlidePrev: !1,
            allowSlideNext: !1,
            navigation: {
                nextEl: ".swiper-button-next",
                prevEl: ".swiper-button-prev"
            },
            breakpoints: {
                1085: {
                    slidesPerView: 1,
                    loop: !1,
                    spaceBetween: 350,
                    allowSlidePrev: !0,
                    allowSlideNext: !0,
                    pagination: {
                        el: ".swiper-pagination",
                        type: "progressbar"
                    },
                    noSwiping: !1
                },
                480: {
                    slidesPerView: 1,
                    loop: !1,
                    spaceBetween: 350,
                    allowSlidePrev: !0,
                    allowSlideNext: !0,
                    pagination: {
                        el: ".swiper-pagination",
                        type: "progressbar"
                    },
                    noSwiping: !1
                },
                320: {
                    slidesPerView: 1,
                    loop: !1,
                    spaceBetween: 350,
                    allowSlidePrev: !0,
                    allowSlideNext: !0,
                    pagination: {
                        el: ".swiper-pagination",
                        type: "progressbar"
                    },
                    noSwiping: !1
                }
            }
        })
    }), $(".menuToggle").on("click", function() {
        $(".list-header").slideToggle(300, function() {
            "none" === $(this).css("display") && $(this).removeAttr("style")
        })
    })
});

